import axios from "axios";
import { tryCatchHandlr } from "../../shared/helpers";

export const submitHandlr = async (e, isLogin) => {
    e.preventDefault();

    console.log(e)

    const registerReq = axios
        .post('/users/register',
            {
                'email': 'email@email.com',
                'password': 'password1'
            },
            {headers: {
                "Content-Type": "application/json",
            }}, 
        );

    const [data, error] = await tryCatchHandlr(registerReq);

    console.log(data, error);
};
